	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_UpdateUser` (IN `_id` INT, IN `_name` VARCHAR(100), IN `_email` VARCHAR(100), IN `_pass` VARCHAR(50), IN `_gender` TINYINT, IN `_avatar` MEDIUMBLOB, IN `_type` VARCHAR(50), IN `_birth` DATE, IN `_update_avatar` BOOLEAN)   BEGIN
	IF _update_avatar = false THEN
    BEGIN 
		UPDATE `user` SET `name`=_name,`email` = _email, `pass` = _pass,`gender`=_gender,
        `date_birth` = _birth where `id_user` = _id;
    END;
